import React from "react";
import styled from 'styled-components';

const Container = styled.div`
    height: 70px;
    border: 1px solid grey;
`;
const EmploymentButton = () => { 
    return(
        <Container> 
            <Banner>
                여기는 버튼자리
            </Banner>
            
        </Container>
    );
}

export default EmploymentButton;
